import React, {useEffect, useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import reactDom from 'react-dom';

function Square({value, onClick}){
  return (
      <button className ="square" onClick={onClick} >
        {value}
      </button>

  )
  }


function ConnectFourBoard ()
  {
    const[square, setSquare] = useState(Array(42).fill(null));
    return(
      <div>
        <div>
        {renderSquare(0)}
        {renderSquare(1)}        
        {renderSquare(2)}
        {renderSquare(3)}        
        {renderSquare(4)}        
        {renderSquare(5)}        
        {renderSquare(6)}
      </div>
      <div>
        {renderSquare(7)}
        {renderSquare(8)}        
        {renderSquare(9)}
        {renderSquare(10)}        
        {renderSquare(11)}        
        {renderSquare(12)}        
        {renderSquare(13)}
      </div>
      <div>
        {renderSquare(14)}
        {renderSquare(15)}        
        {renderSquare(16)}
        {renderSquare(17)}        
        {renderSquare(18)}        
        {renderSquare(19)}        
        {renderSquare(20)}
      </div>
      <div>
        {renderSquare(21)}
        {renderSquare(22)}        
        {renderSquare(23)}
        {renderSquare(24)}        
        {renderSquare(25)}        
        {renderSquare(26)}        
        {renderSquare(27)}
      </div>
      <div>
        {renderSquare(28)}
        {renderSquare(29)}        
        {renderSquare(30)}
        {renderSquare(31)}        
        {renderSquare(32)}        
        {renderSquare(33)}        
        {renderSquare(34)}
      </div>
      <div>
        {renderSquare(35)}
        {renderSquare(36)}        
        {renderSquare(37)}
        {renderSquare(38)}        
        {renderSquare(39)}        
        {renderSquare(40)}        
        {renderSquare(41)}
      </div>
      </div>
    )
    function renderSquare(input) {
      return(
        <Square value = {input} onClick={() =>{
          square[input]= "X"
        }}/>
      )
  }
  }



ReactDOM.render(
  <ConnectFourBoard/>,
  document.getElementById('root')
);

